import React from "react";

function About() {
  return (
    <div
      style={{
        backgroundColor: "#39b247",
        flex: 1,
        display: "flex",
        alignItems: "center",
        justifyContent: "center"
      }}
    >
      <h1>About page</h1>
    </div>
  );
}

export default About;
